import * as C from './LandingStyling';
import { Link } from 'react-router-dom';

export default function Landing() {
    return (
        <C.container>
            <C.hero>
                    <C.button>Get Started</C.button>
            </C.hero>
            <C.overview>
                <C.overviewGif/>
                <C.dropDownGif/>
            </C.overview>
            <C.tools/>
            <C.contact/>
        </C.container>
    );
}
